UPDATE r set age_range_category = 'Maintenance'
from  [c_Age_Range] r  
where age_range_category < 'A'

update [c_Age_Range] set description = '10 Years+' where description = '10+ Years'
update [c_Age_Range] set description = '18 Years+' where description = '18+ Years'
update [c_Age_Range] set description = '20 Years+' where description = '20+ Years'
update [c_Age_Range] set description = '21 Years+' where description = '21+ Years'
update [c_Age_Range] set description = '21 Years+' where description = '21 yrs+'
update [c_Age_Range] set description = '40 Years+' where description = '40+ Years'
update [c_Age_Range] set description = '50 Years+' where description = '50+ Years'

;with to_upd as (
	select age_range_id,
	10 * row_number() over (order by 
	isnull(case when left(age_from_unit,1) = 'D' then 'A' 
		when left(age_from_unit,1) = 'W' then 'B' 
		else left(age_from_unit,1) end,'Z'), 
	isnull(case when left(age_to_unit,1) = 'D' then 'A' 
		when left(age_to_unit,1) = 'W' then 'B' 
		else left(age_to_unit,1) end,'Z'), 
	age_from,
	age_to) as sort_sequence -- select *
	from [dbo].[c_Age_Range]
	where Age_Range_Category = 'Immunization'
)
update r set sort_sequence = t.sort_sequence
from [dbo].[c_Age_Range] r
join to_upd t on t.age_range_id = r.age_range_id
where r.sort_sequence != t.sort_sequence

